import { Children } from "react";

function Card(props) {
    const classes = 'card ' + props.className; 
    // card 에 className 은 남겨두고 props.className 즉 대상의 className을 가져와서 추가한다
    return <div className={classes}>{props.children}</div>
}
export default Card;
